import userEvent from "@testing-library/user-event";
import React from "react";
import  Data  from "./data.json"

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: Data,
    };
  }

  render() {
    return (
      <ul>
        {this.state.data.map(emoji => <li key={emoji.title}>{emoji.symbol}</li>)}
      </ul>
    );
  }
}

export default App;
